import React, { useState } from 'react';
import './App.css';
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem, Button,
  NavLink,InputGroup, InputGroupAddon, InputGroupText, Input
} from 'reactstrap';

const Navig = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);
  var logo = {
    width: "180px"
  };
  return (
    <div>
      <Navbar expand="md">
        <NavbarBrand href="/"><img src="/rockarocket-logo.png" style={logo}/></NavbarBrand>
          <Nav className="mr-auto" navbar>
          </Nav>
          <NavLink href="https://github.com/reactstrap/reactstrap">Log In</NavLink>
      </Navbar>
    </div>
  );
}

function App() {
  var white = {
    color: "white"
  }
  var width = {
    width: "300px"
  }
  var margin = {
    marginLeft:"10px"
  }
  return (
    <div>

      <div className="background">
      <Navig/>
        <div className="container">
          <div className="flex">
          <div className="row">
            <h1 className="display-3 text-center" style={white}>FIND A TRIP</h1>
          </div>
          <div className="row">
            <Input style={width} placeholder="Destination"/>
            <input style={margin} type="date"></input>
            <Button style={margin}>Search</Button>
          </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
